function [result] = lagrange(X,POINTX, POINTY)
    if length(POINTX) == length(POINTY)
        n = length(POINTX) - 1;
        a = polyfit(POINTX, POINTY, n)
        result = polyval(a, X)
    else
        result = NaN;
    end
end
