function result = difdiv(x,y)
    if length(x)==length(y)
        n = length(x);
        for i = 1:n
            m(i,1) = x(i);
        end
        for i = 1:n
            m(i,2) = y(i);
        end
        result = m;
    else
        result = NaN;
    end
end```

